sys_variable_value.value:
(function execute(inputs, outputs) {
    var modelRecord = new GlideRecord(inputs.modelTable);
    modelRecord.addQuery('name',inputs.modelName);
    modelRecord.query();
    
    if (modelRecord.next()){
        outputs.status='update';
        modelRecord.setValue('name',inputs.modelName);
        modelRecord.setValue('short_description',inputs.modelDesc);
        outputs.new_model_id = modelRecord.update();
    }else{
        outputs.status='new';
        modelRecord.setValue('name',inputs.modelName);
        modelRecord.setValue('short_description',inputs.modelDesc);
        outputs.new_model_id = modelRecord.insert();
    }

})(inputs, outputs);

